import React, { useState } from 'react';
import {
    Collapse,
    Navbar,
    NavbarToggler,
    NavbarBrand,
    Nav,
    NavItem,
    NavLink,
    UncontrolledDropdown,
    DropdownToggle,
    DropdownMenu,
    DropdownItem
  } from 'reactstrap/';

const AppNavbar = (props) => {

    const [isOpen, setIsOpen] = useState(false);

    const toggle = () => setIsOpen(!isOpen);

    return (
        <div>
        <Navbar bg="gray.500" className="p-3 mb-5 bg-white rounded" color="light" light expand="md" style={{ boxShadow: "0 1px 3px rgba(0,0,0,0.12), 0 1px 2px rgba(0,0,0,0.24)" }}>
          <NavbarBrand style={{ color: "#212121" }} href="/">InstaPalette</NavbarBrand>
        </Navbar>
      </div>
    );
}

export default AppNavbar;
